import Content from "./Content";
import dummy from "./../db/contents.json";

const BookmarkList = ({ trueIDArr, onBookmarkTrue, onBookmarkFalse }) => {
  return (
    <div>
      <h1>북마크 모아보기</h1>
      <div>
        {dummy.contents
          .filter((contents) => {
            return trueIDArr.includes(contents.id);
          })
          .map((trueContent) => (
            <Content
              key={trueContent.id}
              id={trueContent.id}
              title={trueContent.title}
              trueIDArr={trueIDArr}
              onBookmarkTrue={onBookmarkTrue}
              onBookmarkFalse={onBookmarkFalse}
            ></Content>
          ))}
      </div>
    </div>
  );
};

export default BookmarkList;
